import Chart from '@assets/svg/Chart.svg';
import Document from '@assets/svg/Document.svg';
import Setting from '@assets/svg/Setting.svg';
import Location from '@assets/svg/Location.svg';
import Arrow from '@assets/svg/arrow-left.svg';

const filter = [
    { title: 'مشخصات فنی', icons: Setting },
    { name: 'برند', icon: Arrow },
    { name: 'مدل', icon: Arrow },
    { name: 'سال تولید', icon: Arrow },
    { title: 'مکان خودرو', icons: Location },
    { name: 'استان', icon: Arrow },
    { name: 'شهر', icon: Arrow },
    { title: ' مشخصات فنی خودرو', icons: Document },
    { name: 'نوع خودرو', icon: Arrow },
    { name: 'کیلومتر', icon: Arrow },
    { name: 'گیربکس', icon: Arrow },
    { name: 'سوخت', icon: Arrow },
    { name: 'وضعیت بدنه', icon: Arrow },
    { title: 'قیمت', icons: Chart },
];

export default filter;
